import * as React from 'react';
import TableCell from '@mui/material/TableCell';
import TableRow from '@mui/material/TableRow';
import { Button } from '@mui/material';

export default function Transaction(props) {
  const { transaction: transactionInfo } = props
  const [transaction, setTransaction] = React.useState(transactionInfo);


  const updateTransactionStatus = (event, transaction) => {
    console.log(transaction);
    event.preventDefault();
    setTransaction({
      ...transaction,
      accepted: !transaction.accepted
    })
  }

  return (
    <React.Fragment>
      <TableRow key={transactionInfo._id}>
      <TableCell>{transactionInfo._id}</TableCell>
      <TableCell>{transactionInfo.payorEIN}</TableCell>
      <TableCell>{transactionInfo.payeeId}</TableCell>
      <TableCell>{transactionInfo.employeeId}</TableCell>
      <TableCell>{transactionInfo.accountNumber}</TableCell>
      <TableCell>{transactionInfo.payeeId}</TableCell>
      <TableCell align="center">{`$${transactionInfo.amount}`}</TableCell>
      <TableCell align="center">{transaction.accepted || transactionInfo.accepted.toString()}</TableCell>
      <TableCell align="center">
        <Button
          component="label"
          variant="outlined"
          sx={{ marginRight: "1rem" }}
          onClick={(event) => {updateTransactionStatus(event, transaction)}}
        >
          {(!transaction.accepted).toString()}
        </Button>
      </TableCell>
    </TableRow>
    </React.Fragment>
  );
}
